            <div>
        <p><span>{props.weather.WeatherText}</span></p>{" "}  
        <p>Temperature: <span>{props.temperature.Value}°</span></p>{" "}  
        </div>
        <div>
        <p>Real Feel: <span>{props.realFeel.Value}°</span></p>{" "}  
        <p>Humidity: <span>{props.weather.RelativeHumidity}</span></p>
        </div>
        </div>
      </div>
      </div>
    );
  }
